function eps=drude_lorentz(delta,omega,gamma,lambda)
%delta -> strength of Lorentz oscillator -> comme epsilon sans unit??申?申
%omega -> frequency of Lorentz oscillator -> cm-1
%gamma -> linewidth of Lorentz oscillator -> cm-1
%lambda est rentr??申?申e en microns !

%1) Tout repasser en microns et transformer les omega en [2 pi c / lambda]
c=3e14; %um/s

omegalight=(2*pi*c./lambda);
omegap=omega*0.0001*2*pi*c;
gammap=gamma*0.0001*2*pi*c;

eps=(delta.*omegap.^2)./(omegap.^2-omegalight.^2-1i.*gammap*omegalight);


