function [indice,bornes,ref,ldr,nr,ldi,ni]=indice_algaas(cas,lambda,x)
% Cette fonction retourne l'indice du mat??申?申riau AlxGa1-xAs en fonction du param??申?申tre x
% et de la longueur d'onde exprim??申?申e en microns
% R??申?申f??申?申rence : "Opto??申?申lectronique", Emmanuel Rosencher et Borge Vinter, Masson, chapitre 12.7, P332
ref='Opto??申?申lectronique, Emmanuel Rosencher et Borge Vinter, Masson, chapitre 12.7, P332';
bornes=[0,inf];
E = 1.24./lambda; % E en eV, lambda en microns
lld=[];nn=[];ldr=lld;ldi=lld;nr=real(nn);ni=imag(nn);
if ischar(x);x=0;end;

switch cas;
case 0;ref=['AlxGA1-xAs ',ref];
Eoe = 3.65 + 0.871*x + 0.179*(x^2);
Ed  = 36.1 - 2.45*x;
Eg  = 1.424 + 1.266*x + 0.26*(x^2);
case 1;ref=['PxAs1-xGa ',ref];
Eoe = 3.65 + 0.721*x + 0.139*(x^2);
Ed  = 36.1+0.35*x;
Eg = 1.441 + 1.091*x + 0.21*(x^2);
case 2;ref=['GaxIn1-xP ',ref];
Eoe = 3.391 + 0.524*x + 0.595*(x^2);
Ed = 28.91 + 7.54*x;
Eg = 1.34 + 0.668*x + 0.758*(x^2);
end;


Ef = sqrt((2*(Eoe^2)) - Eg^2);
eta = (pi/2) * (Ed/((Eoe^3)*(Eoe^2 - Eg^2)));
M_1 = (eta/(2*pi))*(Ef^4 - Eg^4);
M_3 = (eta/pi) * (Ef^2 - Eg^2);
epsilon = 1 + M_1 + M_3*(E.^2) + ((eta/pi)*log((Ef^2-E.^2)./(Eg^2 - E.^2))).*E.^4; % Formule d'Afromowitz (corrig??申?申e en 2014 par JPH)

indice = retsqrt(epsilon,-1);



